syntax = "proto3";
option java_package = "emu.grasscutter.net.proto";

message SkipPlayerGameTimeRsp {
	enum ALPCPKGFHFL {
		option allow_alias = true;
		NONE = 0;
		PEPPOHPHJOJ = 166;
		DCDNILFDFLB = 0;
		NNBKOLMPOEA = 1;
		EAJIABGAOCI = 1;
	}

	uint32 clientGametime = 14;
	uint32 gameTime = 15;
    int32 retcode = 12;
}